import React from 'react';
import Navbar from './components/navigation_bar';
import { Button } from '@material-ui/core';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar>
      </Navbar>
      <header className="App-header">
        <center><h1 className="App-title">Welcome to Phuyel Family Association!</h1> </center>
      </header>
      <p className="App-Intro"> This is a paragraph about the jobs you can find here! </p>
      <Button fullWidth> Explore Jobs </Button>
      <Button> Services </Button>
    </div>
  );
}


export default App;
